</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:宋体;line-height:150%;font-size:16px">3.1</span><span style=";font-family:Calibri;line-height:150%;font-size:16px">&nbsp;</span><span style=";font-family:宋体;line-height:150%;font-size:16px"><span style="font-family:宋体">用户提供的资料不真实；</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:宋体;line-height:150%;font-size:16px">3.2</span><span style=";font-family:Calibri;line-height:150%;font-size:16px">&nbsp;</span><span style=";font-family:宋体;line-height:150%;font-size:16px"><span style="font-family:宋体">用户违反本协议中规定的使用规则；</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:宋体;line-height:150%;font-size:16px">3.3</span><span style=";font-family:Calibri;line-height:150%;font-size:16px">&nbsp;</span><span style=";font-family:宋体;line-height:150%;font-size:16px"><span style="font-family:宋体">用户违反本协议其它规定，且自税牛科技通知其纠正之日起</span>10<span style="font-family:宋体">个工作日内仍未纠正的。</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:宋体;line-height:150%;font-size:16px">4<span style="font-family:宋体">、未经财税鱼许可，用户若存在通过任何方式，包括但不限于恶意注册财税鱼账号，机器抓取、复制、镜像等方式不合理地、大批量地获取财税鱼站内信息、资讯、数据等的行为，财税鱼的后台将自动对用户的账号封号且无需向用户承担任何责任。若同一个</span><span style="font-family:FangSong">IP</span><span style="font-family:宋体">地址内多个账号存在多次上述行为，财税鱼后台将有权自动封闭该</span><span style="font-family:FangSong">IP</span><span style="font-family:宋体">地址且无需向用户承担任何责任。因上述行为对财税鱼造成损失的，用户需要承担赔偿责任。</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:Calibri;line-height:150%;font-size:16px">&nbsp;</span>
</p>
<p style="line-height: 150%; text-align: left;">
    <strong><span style="font-family: 宋体;line-height: 150%;font-size: 16px"><span style="font-family:宋体">七</span></span></strong><strong><span style="font-family: FangSong;line-height: 150%;font-size: 16px"><span style="font-family:宋体">、知识产权</span></span></strong>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:FangSong;line-height:150%;font-size:16px"><span style="font-family:宋体">任何一方均有义务尊重对方所享有的知识产权，包括但不限于版权、专利及商标。非为履行本协议目的并经对方认可，任何一方不得擅自使用（包括但不限于：以非法的方式复制、传播、展示、镜像、上载、下载）对方享有知识产权的内容。双方互相许可使用的知识产权内容并不代表权利权属的转移，此许可为非独占非排他性的。</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:FangSong;line-height:150%;font-size:16px">&nbsp;</span>
</p>
<p style="line-height: 150%; text-align: left;">
    <strong><span style="font-family: 宋体;line-height: 150%;font-size: 16px"><span style="font-family:宋体">八</span></span></strong><strong><span style="font-family: FangSong;line-height: 150%;font-size: 16px"><span style="font-family:宋体">、保密义务</span></span></strong>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:FangSong;line-height:150%;font-size:16px">1</span><span style=";font-family:FangSong;line-height:150%;font-size:16px"><span style="font-family:宋体">、甲乙双方均有义务履行保密义务，不得向任何第三方披露或者透露有关本协议项下内容的任何信息及双方因履行本协议而获知的对方的商业秘密，但根据有关法律规定向有权机构（如政府执法部门、证券交易所）必须披露的除外。</span></span>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:FangSong;line-height:150%;font-size:16px">2</span><span style=";font-family:FangSong;line-height:150%;font-size:16px"><span style="font-family:宋体">、商业秘密概括地描述为现在和将来归属于一方的业务数据、客户名单、技术资料、软件程序、财务和其他能为该方带来利益或影响的商业资料。</span></span>
</p>
<p style="line-height: 150%; text-align: left;">
    <strong><span style="font-family: FangSong;line-height: 150%;font-size: 16px">&nbsp;</span></strong>
</p>
<p style="line-height: 150%; text-align: left;">
    <strong><span style="font-family: FangSong;line-height: 150%;font-size: 16px"><span style="font-family:宋体">九、争议解决</span></span></strong>
</p>
<p style="text-indent: 32px; line-height: 150%; text-align: left;">
    <span style=";font-family:宋体;line-height:150%;font-size:16px"><span style="font-family:宋体">本服务协议的解释，效力及纠纷的解决，适用于中华人民共和国大陆地区法律、法规。若用户和税牛科技之间发生任何纠纷或争议，首先应友好协商解决，协商不成的，用户在此完全同意将纠纷或争议提交税牛科技所在地人民法院管辖。</span></span>
</p>
